import React, { useState } from 'react';
import ReactSlider from 'react-slider'
import './YearRangeSelection.css'
import styled from 'styled-components';


const YearRangeSelection = () => {
  const [value, setValue] = React.useState([25, 50]);
    const StyledSlider = styled(ReactSlider)`
    width: 25rem;
    height: 2.5rem;
`;

const StyledThumb = styled.div`
    height: 25px;
    line-height: 80px;
    width: 25px;
    text-align: center;
    background-color: #FFFFFF;
    color: #000;
    border-radius: 50%;
    cursor: grab;
`;

const Thumb = (props, state) => <StyledThumb {...props}>{state.valueNow}</StyledThumb>;

const StyledTrack = styled.div`
    top: 1.1rem;
    bottom: 1.1rem;
    background: ${props => (props.index === 2 ? '#DBE2EA' : props.index === 1 ? '#7C9CBF' : '#DBE2EA')};
    border-radius: 999px;
`;

const Track = (props, state) => <StyledTrack {...props} index={state.index} />;


  return (
    <div>
      {/* <StyledSlider max={2019} min={2010} step={3} minDistance={3} defaultValue={[2010, 2019]} renderTrack={Track} renderThumb={Thumb} /> */}
      <ReactSlider
    value={value}
    onBeforeChange={(value, index) =>
        console.log(`onBeforeChange: ${JSON.stringify({ value, index })}`)
    }
    onChange={(value, index) => console.log(`onChange: ${JSON.stringify({ value, index })}`)}
    onAfterChange={(value, index) =>
        console.log(`onAfterChange: ${JSON.stringify({ value, index })}`)
    }
    className="horizontal-slider"
    thumbClassName="example-thumb"
    trackClassName="example-track"
    renderThumb={(props, state) => <div {...props}>{state.valueNow}</div>}
/>
    </div>
  )
}

export default YearRangeSelection;
